export default class UserDto {
    id;
    email;
    access;

    constructor(data) {
        this.id = data.id;
        this.email = data.email;
        this.access = data.access;
    }

    getNameOfAccess(){
        switch (this.access){
            case 0:
                return "Uživatel"
            case 1:
                return "Administrátor"
            default:
                return "Aktivní"
        }
    }
}
